import React, { useState, useContext } from 'react';
import { Menu, X, User, Search } from 'lucide-react';
import { Link, useNavigate } from 'react-router-dom';
import AuthContext from '../context/AuthContext';

export default function Navbar() {
  // State for mobile menu toggle
  const [isOpen, setIsOpen] = useState(false);

  // Access login state, user role, and logout function from context
  const { isLoggedIn, userRole, logout } = useContext(AuthContext);

  // Navigation hook for programmatic route changes
  const navigate = useNavigate();

  // Handle user sign-out and redirect to home page
  const handleSignOut = () => {
    logout(); // Update global login state by calling logout
    navigate('/', { replace: true }); // Redirect to home page after logout
    setIsOpen(false); // Close mobile menu
  };

  // Define menu items based on login status and user role
  const menuItems = [
    { label: 'Home', href: '/' },
    !isLoggedIn && { label: 'Login', href: '/login' },
    !isLoggedIn && { label: 'Register', href: '/register' },
    isLoggedIn && userRole === 'user' && { label: 'Transactions', href: '/transactions' },
    isLoggedIn && userRole === 'admin' && { label: 'Administrators', href: '/admin' },
    isLoggedIn && userRole === 'admin' && { label: 'Pending Transactions', href: '/pending-transactions' },
    isLoggedIn && { label: 'Sign Out', href: '#', onClick: handleSignOut },
  ].filter(Boolean); // Remove any undefined items based on conditionals

  return (
    <nav className="bg-white border-b border-gray-200">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between h-16">
          {/* Logo and Application Name */}
          <div className="flex items-center">
            <Link to="/" className="flex items-center space-x-2">
              <div className="h-8 w-8 bg-indigo-600 rounded-lg flex items-center justify-center">
                <span className="text-white font-bold text-xl">CP</span>
              </div>
              <span className="text-xl font-semibold text-gray-900">Customer Portal</span>
            </Link>

            {/* Desktop Menu Items */}
            <div className="hidden sm:ml-6 sm:flex sm:space-x-8">
              {menuItems.map((item) => (
                <Link
                  key={item.label}
                  to={item.href !== '#' ? item.href : undefined}
                  onClick={item.onClick || null}
                  className="border-transparent text-gray-500 hover:border-gray-300 hover:text-gray-700 inline-flex items-center px-1 pt-1 border-b-2 text-sm font-medium"
                >
                  {item.label}
                </Link>
              ))}
            </div>
          </div>

          {/* Icons Section (e.g., Search, Profile) for Desktop */}
          <div className="hidden sm:ml-6 sm:flex sm:items-center space-x-4">
            {/* Search Bar */}
            <div className="relative">
              <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
                <Search className="h-5 w-5 text-gray-400" aria-hidden="true" />
              </div>
              <input
                type="text"
                placeholder="Search..."
                className="pl-10 py-2 rounded-md border border-gray-300 focus:ring-indigo-500 focus:border-indigo-500"
                aria-label="Search"
              />
            </div>
            {/* Profile Icon */}
            {isLoggedIn && (
              <div className="relative group">
                <button className="rounded-full focus:outline-none">
                  <User className="h-6 w-6 text-gray-500" />
                </button>
                {/* Profile Dropdown */}
                <div className="absolute right-0 mt-2 w-40 bg-white rounded-md shadow-lg hidden group-hover:block">
                  <Link to="/profile" className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100">
                    Profile
                  </Link>
                  <Link to="/settings" className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100">
                    Settings
                  </Link>
                  <button onClick={handleSignOut} className="block w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-100">
                    Sign Out
                  </button>
                </div>
              </div>
            )}
          </div>

          {/* Hamburger Icon for Mobile Menu Toggle */}
          <div className="flex items-center sm:hidden">
            <button className="p-2" onClick={() => setIsOpen(!isOpen)} aria-label="Toggle Menu">
              {isOpen ? <X className="h-6 w-6 text-gray-500" /> : <Menu className="h-6 w-6 text-gray-500" />}
            </button>
          </div>
        </div>
      </div>

      {/* Mobile Menu (Visible only if isOpen is true) */}
      {isOpen && (
        <div className="sm:hidden">
          <div className="pt-2 pb-3 space-y-1">
            {menuItems.map((item) => (
              <Link
                key={item.label}
                to={item.href !== '#' ? item.href : undefined}
                onClick={() => {
                  item.onClick && item.onClick();
                  setIsOpen(false); // Close mobile menu after click
                }}
                className="text-gray-600 hover:bg-gray-50 hover:text-gray-900 block px-3 py-2 rounded-md text-base font-medium"
              >
                {item.label}
              </Link>
            ))}
          </div>
        </div>
      )}
    </nav>
  );
}
